// src/Navbar.js
import React from 'react';

function Navbar() {
    return (
        <nav style={styles.navbar}>
            <div style={styles.logoContainer}>
                {/* <img src="logo.png" alt="Logo" style={styles.logo} /> */}
                <h1 style={styles.navTitle}>PDF Uploader</h1>
            </div>
            <ul style={styles.navLinks}>
                <li style={styles.navItem}><a href="#home" style={styles.navLink}>Home</a></li>
                <li style={styles.navItem}><a href="#about" style={styles.navLink}>About</a></li>
                <li style={styles.navItem}><a href="#contact" style={styles.navLink}>Contact</a></li>
            </ul>
        </nav>
    );
}

const styles = {
    navbar: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        backgroundColor: '#333',
        padding: '1rem 2rem',
        color: 'white',
    },
    logoContainer: {
        display: 'flex',
        alignItems: 'center',
    },
    logo: {
        width: '40px',
        height: '40px',
        marginRight: '10px',
    },
    navTitle: {
        margin: '0',
        fontSize: '1.5rem',
    },
    navLinks: {
        listStyle: 'none',
        display: 'flex',
        margin: '0',
        padding: '0',
    },
    navItem: {
        marginLeft: '20px',
    },
    navLink: {
        color: 'white',
        textDecoration: 'none',
        fontSize: '1rem',
        transition: 'color 0.3s',
    },
    navLinkHover: {
        color: '#aaa',
    },
};

export default Navbar;
